Talks are made up of actions that are translated into graph nodes. Actions can be defined either via the TalkBuilder (where you have more control over the dialogue graph with custom components and events) or with "talk.ron" asset files. With the latter, you are building dialogue nodes by passing Action data: struct Action { /// The ID of the action. id: ActionId, /// The kind of action. action: NodeKind, /// The actors involved in the action. actors: Vec<ActorSlug>, /// Any choices that the user can make during the action. choices: Option<Vec<Choice>>, /// The text of the action. text: Option<String>, /// The ID of the next action to perform. next: Option<ActionId>,
} It contains several fields that define the kind of action it can be, the relevant actors, text or choices and the next action to perform (where to go in the graph after). The actors are quite simple right now. It is just the name and an identifier (the slug): struct Actor { /// The name of the actor. name: String, /// The unique slug of the actor. slug: ActorSlug,
} Having a well defined Talk with actions and actors will result in spawning a graph where all the nodes are entities. Each action will be an entity "node", and each actor is also an entity. All the action nodes will be connected with each other with an aery relationship (called FollowedBy ), following the graph structure given by the actions next and id fields, and each action with actors will result in the corresponding entity being connected with the actors entities with another aery relationship (called PerformedBy ).

