Now that we have a talk, let's add it to our game. To load the asset: let h: Handle<TalkData> = asset_server.load("hello.talk.ron"); That creates a TalkData asset. We need to store that handle so we can retrieve the actual TalkData and use it to spawn the action entities in the world: #[derive(Resource)]
struct MyTalkHandle(Handle<TalkData>); fn load_talks(mut commands: Commands, server: Res<AssetServer>) { let h: Handle<TalkData> = server.load("hello.talk.ron"); commands.insert_resource(MyTalkHandle(h));
} Now that we have the system that loads the talk, we need to spawn it in the world. We can do that in another system: fn spawn_talk( mut commands: Commands, talks: Res<Assets<TalkData>>, talk_handle: Res<MyTalkHandle>,
) { let my_talk = talks.get(&talk_handle.0).unwrap(); let talk_builder = TalkBuilder::default().fill_with_talk_data(my_talk); // create a TalkBuilder with the TalkData commands.spawn_talk(talk_builder, ()); // spawn the graph with a commands extension
} Alright! Now we have just spawned a graph of entities where each action is an entity with their own components. The actions performed by actors are also connected to the actors entities (just Bob in our case). The entire graph is a child of a main entity with the Talk component, you can use it to identify the graph in the world.

21.body:
The plugin doesn't provide any UI system right now, so you can use whatever you want to display the dialogue. A dialogue graph sends you events everytime you move to a new node, so you can create small systems that listen to the different events. fn print_text(mut text_events: EventReader<TextNodeEvent>) { for txt_ev in text_events.read() { let mut speaker = "Narrator"; if !txt_ev.actors.is_empty() { speaker = &txt_ev.actors[0]; } println!("{speaker}: {}", txt_ev.text); }
} fn print_join(mut join_events: EventReader<JoinNodeEvent>) { for join_event in join_events.read() { println!("--- {:?} enters the scene.", join_event.actors); }
} fn print_leave(mut leave_events: EventReader<LeaveNodeEvent>) { for leave_event in leave_events.read() { println!("--- {:?} exit the scene.", leave_event.actors); }
} fn print_choice(mut choice_events: EventReader<ChoiceNodeEvent>) { for choice_event in choice_events.read() { println!("Choices:"); for (i, choice) in choice_event.choices.iter().enumerate() { println!("{}: {}", i + 1, choice.text); } }
} The basics events are the TextNodeEvent, JoinNodeEvent, LeaveNodeEvent and ChoiceNodeEvent. They all have the actors field to quickly access the actor names. In case of no actors (empty vector) we're defaulting to "Narrator".

