We spawned and are listening to the talk events, but we can't interact with it to move forward (or pick a choice). To do that, the plugin has another kind of events: the "Request" events that you can send. Here the 2 that we will use: NextNodeRequest and ChooseNodeRequest. They both need the entity with the Talk component you want to update, and for the ChooseNodeRequest you also need to provide the entity of the next action to go to. /// Advance the talk when the space key is pressed and select choices with 1 and 2.
fn interact( input: Res<Input<KeyCode>>, mut next_action_events: EventWriter<NextNodeRequest>, mut choose_action_events: EventWriter<ChooseNodeRequest>, talks: Query<Entity, With<Talk>>, choices: Query<&ChoiceNode, With<CurrentNode>>,
) { let talk_ent = talks.single(); if input.just_pressed(KeyCode::Space) { next_action_events.send(NextNodeRequest::new(talk_ent)); } // Note that you CAN have a TextNode component and a ChoiceNode component at the same time. // It would allow you to display some text beside the choices. if choices.iter().count() == 0 { return; } let choice_node = choices.single(); if input.just_pressed(KeyCode::Key1) { choose_action_events.send(ChooseNodeRequest::new(talk_ent, choice_node.0[0].next)); } else if input.just_pressed(KeyCode::Key2) { choose_action_events.send(ChooseNodeRequest::new(talk_ent, choice_node.0[1].next)); }
} To grab the Talk entity for the events is pretty easy, just query for it. For the ChooseNodeRequest event we need access to the possible choices if the current node has the ChoiceNode component. To grab them we can do a query on the special CurrentNode that is attached only to the current node entity in a graph (note that if you have multiple dialogue graphs you will have multiple CurrentNodes and you will have to filter them).

