Depending on your needs, building a dialogue graph via code can be more or less verbose. A simple, linear, conversation such as: graph LR A((Start)) --> B[Say] B --> C[Say] can be built with just a few lines of code: let talk_builder = Talk::builder().say("Hello").say("World");
let talk_commands = commands.talks();
commands.spawn_talk(talk_builder); To actually spawn the entities with the relationships, you pass the TalkBuilder to the Commands::spawn_talk method, which will prepare a Command to be added to the command queue. The command, when applied, will first spawn the main parent entity of the graph with the Talk component. Then add a start node with StartNode component (the entry point of the graph) and finally spawn entities for each say, choose etc. Usually the builder will connect the entities linearly based on the concatenated methods, with the only exception being the choose method which is used for branching. In the example above you would have 3 entities each in a relationship with the next one (start -> say -> say), all children of the main Talk entity. You can check out all the methods that the builder provides in the API docs .

