The dialogue graph emits events when a node is reached. The way it does that is by using the NodeEventEmitter trait for the node components that implement it. /// Trait to implement on dialogue node components to make them emit an event when reached.
#[bevy_trait_query::queryable]
pub trait NodeEventEmitter { /// Creates an event to be emitted when a node is reached. fn make(&self, actors: &[Actor]) -> Box<dyn Reflect>;
} In case of say, choose, join and leave the builder will spawn an entity and add the TextNode, ChoiceNode, JoinNode and LeaveNode components respectively. Each of these components implement the NodeEventEmitter trait. The idea is that you can create a Component, implement the trait so you can create an Event (optionally injecting the active actors) and then use that event to trigger some logic in your game. You can check out the custom_node_event example to see how to implement custom events. You will see that there is also a macro to help you with that and that you need to register the component (and event) with the app.register_node_event::<C, T>().

