That's the events from a dialogue graph to you. There is also the other direction so you can send requests to the dialogue graph (to advance the dialogue). To move forward to the next action: /// Event to request the next node in a `Talk`.
/// It requires an entity with the `Talk` component you want to update.
#[derive(Event)]
pub struct NextNodeRequest { /// The entity with the `Talk` component you want to update. pub talk: Entity,
} To jump to a specific action (used with choices): /// An event to jump to some specific node in a graph. /// It requires an entity with the `Talk` component you want to update.
#[derive(Event)]
pub struct ChooseNodeRequest { /// The entity with the `Talk` component you want to update. pub talk: Entity, /// The next entity to go to. pub next: Entity,
} There is also an useful event to re-send all the events associated to a node: /// Event to request the current node to re-send all its events.
#[derive(Event)]
pub struct RefireNodeRequest { /// The entity with the `Talk` component you want to update. pub talk: Entity,
} You pass the entity with the Talk component in these events, plus the next node entity in case of the choose event. Check out the examples folder to see how to use the plugin. simple.rs shows how to use the plugin to create a simple, linear conversation. choices.rs shows how to use the plugin to create a conversation with choices (jumps in the graph). full.rs shows a Talk where all the action kinds are used. ingame.rs shows how to use the plugin with more than one talk you can interact with. custom_node_event.rs shows how to add your own event emitting component to create a custom node.
